import styled from "styled-components";
import { TChatMessage } from 'types/chat';
import { FaUser } from 'react-icons/fa';

const ChatListWrapper = styled.div`
  width:100%;
  height:100%;
  display:flex;
  flex-flow: row wrap;
  min-height:300px;
`; 

interface Props {  
  readonly datas: TChatMessage[];
}

const ChatList = ({ datas }:Props):JSX.Element=> {

  return ( 
    <ChatListWrapper>

      {datas.map((item: TChatMessage) => (
        <div key={item.id}> 
          {JSON.stringify(item)} 
          <div className="avatar">
            {item.profile ? (<img src={item.profile} alt="avatar"/> ) : (<div className="anonimous"><FaUser /></div>)}
          </div>
          <div>
            {item.nickname}
          </div>
        </div>
      ))}

    </ChatListWrapper>  
  )

}

export default ChatList;
